import "./header.css";

function Header() {
  return (
    <div className="header">
      <div className="headerTitles">
        <h1 className="headerTitleBlog">WELCOME</h1>
        <p>to <b>Blog</b></p>
      </div>
      <img
        className="headerImg"
        src="https://images.unsplash.com/photo-1476490445914-cc8ed84a4277?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1yZWxhdGVkfDE5fHx8ZW58MHx8fHw%3D&w=1000&q=80"
        alt=""
      />
    </div>
  );
}

export default Header;
